
package net.myorb.testing.spline;

import net.myorb.library.Gamma;

import net.myorb.math.complexnumbers.ComplexValue;
import net.myorb.math.computational.Parameterization;

import net.myorb.math.expressions.managers.ExpressionFloatingFieldManager;
import net.myorb.math.SpaceManager;

public class GammaPrecision
{

	static SpaceManager<Double> dmgr = new ExpressionFloatingFieldManager ();

	public static void main (String[] a) throws Exception
	{

		Parameterization p = new Parameterization ();

		p.set ("maxsegments", 70);
		p.set ("maxerror", 1E-11);
		p.set ("mindelta", 1E-6);
//		p.set ("trace", 1);

		Gamma G = new Gamma (p);

		long count = 0, sum = 0,
			biggest = 0, smallest = 9999999;
		ComplexValue<Double> gz;
		long start, done, dur;

		for (double r = 1.0; r <= 8.0; r += 0.25)
		{
			for (double i = 1.0; i <= 8.0; i += 0.25)
			{
				start = System.currentTimeMillis ();
				gz = G.eval (new ComplexValue<Double> (r, i, dmgr));
				done = System.currentTimeMillis ();
				dur = done - start; count++;
				sum += dur;

				if (dur < smallest) smallest = dur;
				if (dur > biggest) biggest = dur;

				System.out.print (gz);
				System.out.print ("\t");
			}
			System.out.println ();
		}

		long average = sum / count;
		System.out.println ("smallest=" + smallest);
		System.out.println ("biggest=" + biggest);
		System.out.println ("average=" + average);

	}

}

